import './App.css';
import PhotoViewer from './PhotoViewer';

function App() {
  return (
    <div className="App">
      <header className='App-header'>
        <h1>Photo Viewer</h1>
        <PhotoViewer />
      </header>
    </div>
  );
}

export default App;
